import React from 'react';
import LikedVideo from '../../components/LikedVideo/likedVideo';
import SideNavbar from '../../components/SideNavbar/sideNavbar';

function videos() {
  return (
    <div>
      <SideNavbar sideNavbar={sideNavbar}/>
      <LikedVideo/>
    </div>
  )
}

export default videos;
